`timescale 1ns / 1ps
module BatchNormalization_tb;
reg clk;
reg signed[(10*10*10*16)-1:0] maps;
reg signed [(10*16)-1:0]gmbvc;
reg signed [(10*16)-1:0]gvc;
wire signed [(10*10*10*16)-1:0] outmaps;
integer i;
localparam SF2=2.0**-16.0;

BatchNormalization uut(
.clk(clk),
.batches(maps),
.gmbvc(gmbvc),
.gvc(gvc),
.outbatches(outmaps)

);
localparam SF=2.0**-8.0;
always #5 clk=~clk;
initial begin
clk=1'b0;
maps=16000';
gmbvc=160'b1111101101000000111110110100000011111011010000001111101101000000111110110100000011111011010000001111101101000000111110110100000011111011010000001111101101000000;
gvc=160'b0000010011000000000001001100000000000100110000000000010011000000000001001100000000000100110000000000010011000000000001001100000000000100110000000000010011000000;
#1120
maps=16000';

end
always@(uut.uut.rst) begin
$display("Time: %0d | Result values:", $time);

$display("rst=%d", uut.uut.rst);

end
always@(uut.uut.rowcounter) begin
$display("Time: %0d | Result values:", $time);
$display("rowcount=%d", uut.uut.rowcounter);
end
always@(uut.currgmbvc) begin
$display("Time: %0d | Result values:", $time);
$display("currgmbvc=%f", uut.currgmbvc*SF);

end
always@(uut.uut.map) begin
$display("Time: %0d | Result values:", $time);
for(i=0;i<100;i=i+1) begin
$display("map[%d]=%f",i,uut.uut.map[16*i+:16]*SF);
end
end
always@(uut.channel_counter) begin
$display("Time: %0d | Result values:", $time);
$display("channelcounter=%d", uut.channel_counter);
end
always@(uut.clkcounter) begin
$display("Time: %0d | Result values:", $time);
$display("clkcounter=%d", uut.clkcounter);
end
always@(uut.channel) begin
$display("Time: %0d | Result values:", $time);
for(i=0;i<100;i=i+1) begin
$display("channel[%d]=%f",i,uut.channel[16*i+:16]*SF);
end
end
always@(uut.uut.out1) begin
$display("Time: %0d | Result values:", $time);
$display("out1=%f", uut.uut.out1*SF2);
$display("out1=%b",uut.uut.out1);
end
always@(uut.uut.outsimplified) begin
$display("Time: %0d | Result values:", $time);
$display("outsimplified=%f", uut.uut.outsimplified*SF);
end
always@(uut.outchannel) begin
$display("Time: %0d | Result values:", $time);
for(i=0;i<100;i=i+1) begin
$display("outchannel[%d]=%f",i,uut.outchannel[16*i+:16]*SF);
end
end
//always@(uut.uut.outmap) begin
//$display("Time: %0d | Result values:", $time);
//for(i=0;i<100;i=i+1) begin
//$display("BN_outmaps[%d]=%f",i,uut.uut.outmap[16*i+:16]*SF);
//end

//end
always@(outmaps) begin
$display("Time: %0d | Result values:", $time);
for(i=0;i<1000;i=i+1) begin
$display("outbatches[%d]=%f",i,outmaps[16*i+:16]*SF);
end
end


endmodule
